import React, { useEffect, useState } from "react";
import axios from "axios";

export default function Prueba() {
  const [bajones, setBajones] = useState([]);

  useEffect(() => {
    axios
      .get("/prueba")
      .then((res) => {
        const data = res.data;
        setBajones(data);
      })
      .catch((err) => console.log(err));
  }, []);

  return (
    <div>

    <form>
      <input placeholder=""/>
      <input></input>
      <button>login</button>
    </form>
    </div>
  );
}
